import './App.css';
import {Component} from "react";

class App extends Component {
    render() {
        return (<div>
                <div className='app-wrapper'>
                    <header className='header'>
                        <img src='https://i.pinimg.com/originals/4b/bd/e4/4bbde43d0b17ca846d39bff716213dff.jpg'/>
                    </header>
                    <nav className='nav'>
                        <div>
                            <a>Profile of Gods</a>
                        </div>
                        <div>
                            <a>Message from people</a>
                        </div>
                        <div>
                            <a>Song of Valkyrie</a>
                        </div>
                    </nav>
                    <div className='content'>Main content</div>
                </div>
            </div>
        );
    }
}


export default App;
